import React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import Chip from '@mui/material/Chip';
import AudiotrackIcon from '@mui/icons-material/Audiotrack';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { PieChart, Pie, Cell, BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer } from 'recharts';
// Colors for charts
const COLORS = ['#43a047', '#e53935', '#fbc02d', '#1e88e5', '#8e24aa'];

export default function ComprehensiveReportDisplay({ report }) {
    if (!report) return null;

    // Always prefer model output from analysis_json if present
    let fields = {};
    if (report.analysis_json) {
        fields = report.analysis_json;
    } else if (report.full_report) {
        // Try to parse model output from full_report if analysis_json missing
        try {
            const match = report.full_report.match(/MODEL OUTPUT JSON:(\s*\{[\s\S]*?\})/);
            if (match) {
                fields = JSON.parse(match[1]);
            }
        } catch (e) {
            fields = {};
        }
    }
    const fallback = report.parsedReport || {};

    // Statistics
    const violationCount = Array.isArray(fields.frame_analysis?.violation_categories)
        ? fields.frame_analysis.violation_categories.length
        : 0;
    const safeFrames = typeof fields.frame_analysis?.safe_frames === 'number' ? fields.frame_analysis.safe_frames : 0;
    const totalFrames = typeof fields.frame_analysis?.total_frames === 'number' ? fields.frame_analysis.total_frames : 0;
    const complianceRate = totalFrames > 0 ? Math.round((safeFrames / totalFrames) * 100) : 0;

    // Content extraction
    const transcript = fields.audio_analysis?.transcript || fields.transcript || fallback.transcript || '';
    const ocrText = fields.ocr_results?.text || fields.text_in_video?.text || fallback.ocr_text || '';
    const ocrItems = fields.ocr_results?.extracted_items || fields.text_in_video?.extracted_items || fallback.ocr_items || [];
    const blipDescriptions = fields.frame_analysis?.blip_descriptions || fallback.blip_descriptions || [];
    // Copyright: prefer model output if present
    const copyrightCheck = fields.copyright_check || report.copyright_check || null;

    // Prepare chart data (after complianceRate and fields are defined)
    const complianceData = [
        { name: 'Compliant', value: complianceRate, color: '#43a047' },
        { name: 'Non-Compliant', value: 100 - complianceRate, color: '#e53935' }
    ];
    const violationCategories = Array.isArray(fields.frame_analysis?.violation_categories) ? fields.frame_analysis.violation_categories : [];
    const violationData = violationCategories.map((cat, idx) => ({ name: cat, value: 1, color: COLORS[idx % COLORS.length] }));
    const scoreData = [
        { name: 'Text', value: fields.text_score || 0 },
        { name: 'Image', value: fields.image_score || 0 }
    ];

    // Transcript safety logic (define helpers)
    const badWords = fields.audio_analysis?.bad_words || [];
    const badPatterns = fields.audio_analysis?.bad_patterns || [];
    const isInappropriate = badWords.length > 0 || badPatterns.length > 0;
    let transcriptSafetyStatus = '';
    if (transcript === '') {
        transcriptSafetyStatus = 'No transcript available';
    } else if (isInappropriate) {
        if (badWords.length > 0) {
            transcriptSafetyStatus = 'Flagged: Inappropriate language detected';
        } else if (badPatterns.length > 0) {
            transcriptSafetyStatus = 'Close: Censored or partial inappropriate language detected';
        } else {
            transcriptSafetyStatus = 'Flagged: Inappropriate language detected';
        }
    } else {
        transcriptSafetyStatus = 'Safe: No inappropriate language detected';
    }

    return (
        <Box sx={{ width: '100vw', height: '100vh', background: '#f7f8fa', display: 'flex', flexDirection: 'column', alignItems: 'center', p: 2 }}>
            {/* Debug: Show raw model output if fields are empty */}
            {Object.keys(fields).length === 0 && report.full_report && (
                <Card sx={{ mb: 2, background: '#fffde7', border: '1px solid #ffd54f' }}>
                    <CardContent>
                        <Typography variant="subtitle2" color="warning.main" sx={{ fontWeight: 'bold' }}>Raw Model Output (Debug)</Typography>
                        <pre style={{ fontSize: 12, maxHeight: 200, overflow: 'auto', background: '#fffde7', borderRadius: 4, padding: 8 }}>{report.full_report}</pre>
                    </CardContent>
                </Card>
            )}
            {/* Top summary cards */}
            <Box sx={{ width: '100%', maxWidth: 1100, display: 'flex', flexDirection: 'row', gap: 2, mb: 2, justifyContent: 'center' }}>
                <Card sx={{ flex: 1, boxShadow: 2, borderRadius: 3, p: 2 }}>
                    <CardContent>
                        <Typography variant="subtitle2" sx={{ fontWeight: 'bold', color: '#1976d2', mb: 1 }}>Compliance Rate</Typography>
                        <PieChart width={120} height={120}>
                            <Pie data={complianceData} dataKey="value" cx="50%" cy="50%" innerRadius={40} outerRadius={55} startAngle={90} endAngle={450}>
                                {complianceData.map((entry, idx) => (
                                    <Cell key={`cell-${idx}`} fill={entry.color} />
                                ))}
                            </Pie>
                        </PieChart>
                        <Typography variant="h6" sx={{ color: complianceRate > 50 ? '#43a047' : '#e53935', fontWeight: 'bold', mt: -2 }}>{complianceRate}%</Typography>
                        <Chip label={complianceRate > 50 ? 'Compliant' : 'Non-Compliant'} color={complianceRate > 50 ? 'success' : 'error'} sx={{ mt: 1, fontWeight: 'bold' }} />
                    </CardContent>
                </Card>
                <Card sx={{ flex: 1, boxShadow: 2, borderRadius: 3, p: 2 }}>
                    <CardContent>
                        <Typography variant="subtitle2" sx={{ fontWeight: 'bold', color: '#1976d2', mb: 1 }}>Violations</Typography>
                        <BarChart width={120} height={120} data={violationData} layout="vertical">
                            <XAxis type="number" hide domain={[0, 2]} />
                            <YAxis type="category" dataKey="name" width={80} />
                            <Bar dataKey="value">
                                {violationData.map((entry, idx) => (
                                    <Cell key={`bar-${idx}`} fill={entry.color} />
                                ))}
                            </Bar>
                        </BarChart>
                        <Typography variant="h6" sx={{ color: '#e53935', fontWeight: 'bold', mt: -2 }}>{violationCount}</Typography>
                        <Chip label="Violations" color="error" sx={{ mt: 1, fontWeight: 'bold' }} />
                    </CardContent>
                </Card>
                <Card sx={{ flex: 1, boxShadow: 2, borderRadius: 3, p: 2 }}>
                    <CardContent>
                        <Typography variant="subtitle2" sx={{ fontWeight: 'bold', color: '#1976d2', mb: 1 }}>Scores</Typography>
                        <BarChart width={120} height={120} data={scoreData}>
                            <XAxis dataKey="name" />
                            <YAxis domain={[0, 100]} />
                            <Bar dataKey="value" fill="#1e88e5" />
                        </BarChart>
                    </CardContent>
                </Card>
            </Box>
            {/* Main content: left and right columns */}
            <Box sx={{ width: '100%', maxWidth: 1100, display: 'flex', flexDirection: 'row', gap: 2, alignItems: 'stretch', justifyContent: 'center' }}>
                {/* Left: Transcript Safety & Extracted Content */}
                <Box sx={{ flex: 1, minWidth: 320, background: '#f5faff', borderRadius: 3, boxShadow: 2, p: 2, overflow: 'auto', height: '100%' }}>
                    <Card sx={{ boxShadow: 1, borderRadius: 2, mb: 2 }}>
                        <CardContent>
                            <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                                <AudiotrackIcon color="info" sx={{ fontSize: 28, mr: 1 }} />
                                <Typography variant="h6" sx={{ fontWeight: 'bold' }}>Transcript Safety (Model Output)</Typography>
                            </Box>
                            <Chip label={transcriptSafetyStatus} color={transcriptSafetyStatus.startsWith('Safe') ? 'success' : transcriptSafetyStatus.startsWith('Close') ? 'warning' : transcriptSafetyStatus.startsWith('No') ? 'warning' : 'error'} sx={{ fontWeight: 'bold', fontSize: 15, mb: 1 }} />
                            {isInappropriate && (badWords.length > 0 || badPatterns.length > 0) && (
                                <Typography variant="body2" sx={{ color: transcriptSafetyStatus.startsWith('Close') ? 'warning.main' : 'error.main', mt: 1 }}>
                                    {badWords.length > 0 && `Bad words: ${badWords.join(', ')}`}
                                    {badPatterns.length > 0 && `Close matches or censored forms detected.`}
                                </Typography>
                            )}
                        </CardContent>
                    </Card>
                    <Card sx={{ boxShadow: 1, borderRadius: 2, mb: 2 }}>
                        <CardContent>
                            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 1 }}>Extracted Content (Model Output)</Typography>
                            <Typography variant="body2" sx={{ fontWeight: 'bold', mb: 1 }}>Audio Transcript:</Typography>
                            <Typography variant="body2" sx={{ fontStyle: 'italic', mb: 1 }}>{transcript || 'No transcript available.'}</Typography>
                            <Typography variant="body2" sx={{ fontWeight: 'bold', mb: 1 }}>OCR Text:</Typography>
                            <Typography variant="body2" sx={{ fontStyle: 'italic', mb: 1 }}>{ocrText || 'No OCR text.'}</Typography>
                            <Typography variant="body2" sx={{ fontWeight: 'bold', mb: 1 }}>OCR Items:</Typography>
                            {ocrItems.length > 0 ? (
                                <Box sx={{ mt: 1, display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                                    {ocrItems.map((item, idx) => (
                                        <Chip key={idx} label={item} color="info" />
                                    ))}
                                </Box>
                            ) : (
                                <Typography variant="body2" color="success.main">None detected.</Typography>
                            )}
                        </CardContent>
                    </Card>
                </Box>
                {/* Right: Model Analysis Report (collapsible) */}
                <Box sx={{ flex: 2, minWidth: 400, background: '#f8f8ff', borderRadius: 3, boxShadow: 2, p: 2, overflow: 'auto', height: '100%' }}>
                    <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 2 }}>Model Analysis Report</Typography>
                    <Accordion defaultExpanded>
                        <AccordionSummary expandIcon={<ExpandMoreIcon />}><Typography sx={{ fontWeight: 'bold' }}>General Info (Model Output)</Typography></AccordionSummary>
                        <AccordionDetails>
                            <Typography variant="body2">Duration: <b>{fields.video_info?.duration || fields.video_info?.duration_formatted || 'N/A'}</b></Typography>
                            <Typography variant="body2">Resolution: <b>{fields.video_info?.resolution || 'N/A'}</b></Typography>
                            <Typography variant="body2">FPS: <b>{fields.video_info?.fps || 'N/A'}</b></Typography>
                            <Typography variant="body2">Processing Time: <b>{fields.processing_time || 'N/A'}</b></Typography>
                        </AccordionDetails>
                    </Accordion>
                    <Accordion>
                        <AccordionSummary expandIcon={<ExpandMoreIcon />}><Typography sx={{ fontWeight: 'bold' }}>Text Analysis (Model Output)</Typography></AccordionSummary>
                        <AccordionDetails>
                            <Typography variant="body2">Score: <b>{fields.text_score || 'N/A'}%</b></Typography>
                            <Typography variant="body2">Issues: <b>{fields.text_issues || 'None'}</b></Typography>
                        </AccordionDetails>
                    </Accordion>
                    <Accordion>
                        <AccordionSummary expandIcon={<ExpandMoreIcon />}><Typography sx={{ fontWeight: 'bold' }}>Audio Analysis (Model Output)</Typography></AccordionSummary>
                        <AccordionDetails>
                            <Typography variant="body2">Score: <b>{fields.audio_score || 'N/A'}%</b></Typography>
                            <Typography variant="body2">Issues: <b>{fields.audio_issues || 'None'}</b></Typography>
                        </AccordionDetails>
                    </Accordion>
                    <Accordion>
                        <AccordionSummary expandIcon={<ExpandMoreIcon />}><Typography sx={{ fontWeight: 'bold' }}>Frame/Image Analysis (Model Output)</Typography></AccordionSummary>
                        <AccordionDetails>
                            <Typography variant="body2">Score: <b>{fields.image_score || 'N/A'}%</b></Typography>
                            <Typography variant="body2">Issues: <b>{fields.image_issues || 'None'}</b></Typography>
                        </AccordionDetails>
                    </Accordion>
                    <Accordion>
                        <AccordionSummary expandIcon={<ExpandMoreIcon />}><Typography sx={{ fontWeight: 'bold' }}>Copyright Analysis</Typography></AccordionSummary>
                        <AccordionDetails>
                            <Typography variant="body2">Status: <b>{copyrightCheck?.status || fields.copyright_status || 'N/A'}</b></Typography>
                            <Typography variant="body2">Details: <b>{copyrightCheck?.details || fields.copyright_details || 'No details available.'}</b></Typography>
                        </AccordionDetails>
                    </Accordion>
                    <Accordion>
                        <AccordionSummary expandIcon={<ExpandMoreIcon />}><Typography sx={{ fontWeight: 'bold' }}>Overall Compliance (Model Output)</Typography></AccordionSummary>
                        <AccordionDetails>
                            <Typography variant="body2">Status: <b>{fields.overall || 'N/A'}</b></Typography>
                            <Typography variant="body2">Scores: <b>Text: {fields.overall_scores?.text || 'N/A'}% | Audio: {fields.overall_scores?.audio || 'N/A'}% | Image: {fields.overall_scores?.image || 'N/A'}%</b></Typography>
                        </AccordionDetails>
                    </Accordion>
                </Box>
            </Box>
        </Box>
    );
}
